Change default value This configuration has "kanagawa" as the default colorscheme value. If you want to change the default value, you can modify the M.theme variable. local M = { theme = "kanagawa" -- <- change this value
} Change local value There is also another mechanism to modify this value. You can create a file named custom.lua under the lua directory. Then return a table value in the below form: -- ~/.config/nvim/lua/custom.lua local M = { theme = "deus"
} return M The custom.lua file is ignored by git, so you can change the colorscheme whatever you like. Additionally, with this custom script file, you can switch day and night theme automatically. Example script: -- ~/.config/nvim/lua/custom.lua local M = { -- leave this unchange theme = "", -- Here define the colorscheme for day day_theme = "github_light", -- Here define the colorscheme for night night_theme = "kanagawa", -- Here setup night mode duration with format "Hour:Min" darkmode_time = { begin = "19:00", ending = "7:00", },
} -- This function will parse our string time to a table to a unix timestamp
local function parse_time(str) if str then local hour, min = str:match("(%d+):(%d+)") return os.time({ hour = hour, min = min, day = 1, month = 1, year = 1970, }) end
end -- if user setup the darkmode related fields
if M.darkmode_time and M.darkmode_time.begin and M.darkmode_time.ending then local begin = parse_time(M.darkmode_time.begin) local ending = parse_time(M.darkmode_time.ending) local now = parse_time(os.date("%H:%M")) -- we might want the 7:00 in next day if ending < begin then -- add 24 hour ending = ending + 72000 end -- if the night has come if (now >= begin) and (now <= ending) then M.theme = M.night_theme else M.theme = M.day_theme end
end return M

