Create a file named custom.lua under the ~/.config/nvim/lua directory. The .gitignore file contains the custom.lua file already. Create a new configuration table and return it at the end. -- example
local my_config = { -- the global theme settings theme = "kanagawa", langs = { "bash", "comment", "fish", "html", "json", "nix", "rust", "toml", { "vim" }, { "go", "gopls" }, { "lua", "sumneko_lua" }, { "c", "clangd" }, -- require npm { "cpp", "clangd" }, -- require npm { "javascript", "eslint" }, -- require npm { "python", "pyright" }, -- require npm }, null_ls = { enable_stylua_fmt = false, -- require stylua executable }, autocmd_enable = { fcitx5 = false, -- require fcitx5-remote lastline = false, diff_on_commit = false, -- might mess up your window }, markdown = { -- must be executable preview_browser = "chrome", },
} return my_config -- <- Don't forget to return this table, or the config will not acceive what you configured

