Modify the lua/custom.lua file. Add a pair inside the langs field in this form: { "filetype", "server name" }. You can check filetype by using command echo &filetype. Example: -- file: lua/custom.lua
local custom = { langs = { { "c", "clangd" }, { "cpp", "clangd" }, { "go", "gopls" }, { "javascript", "eslint" }, { "typescript", "eslint" }, { "python", "pyright" }, }
} return custom You can use command :LspInstall <Language> to install new lspserver. This command is provided by nvim-lsp-installer . And you can use the :LspInstallInfo to use a panel to manage the servers. Rust server is also automatically installed and set up by rust-tools.nvim. For detail please read Rust.md(WIP) Lua server is installed and pre-configured by default, you don't need to configured it too.

